// RelatorioConfronto.js
import React from "react";

const DadosAPagar = ({ dados }) => (
  <div>
    <h2>Dados a Pagar</h2>
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Descrição</th>
          <th>Data de Vencimento</th>
          <th>Valor</th>
        </tr>
      </thead>
      <tbody>
        {dados.map((item) => (
          <tr key={item.ID}>
            <td>{item.ID}</td>
            <td>{item.Descricao}</td>
            <td>{item.DataVencimento}</td>
            <td>{item.Valor}</td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
);

const DadosAReceber = ({ dados }) => (
  <div>
    <h2>Dados a Receber</h2>
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Descrição</th>
          <th>Data de Vencimento</th>
          <th>Valor</th>
        </tr>
      </thead>
      <tbody>
        {dados.map((item) => (
          <tr key={item.ID}>
            <td>{item.ID}</td>
            <td>{item.Descricao}</td>
            <td>{item.DataVencimento}</td>
            <td>{item.Valor}</td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
);

const ResumoGeral = ({ totalAPagar, totalAReceber, saldoLiquido }) => (
  <div>
    <h2>Resumo Geral</h2>
    <p>Total a Pagar: {totalAPagar}</p>
    <p>Total a Receber: {totalAReceber}</p>
    <p>Saldo Líquido: {saldoLiquido}</p>
  </div>
);

const RelatorioConfronto = ({ dadosAPagar, dadosAReceber, resumo }) => (
  <div>
    <h1>Relatório de Confronto: Dados a Pagar vs. Dados a Receber</h1>
    <ResumoGeral
      totalAPagar={resumo.totalAPagar}
      totalAReceber={resumo.totalAReceber}
      saldoLiquido={resumo.saldoLiquido}
    />
    <DadosAPagar dados={dadosAPagar} />
    <DadosAReceber dados={dadosAReceber} />
  </div>
);

export default RelatorioConfronto;
